import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.mockito.Mockito.*;

import java.util.Date;

import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;

public class SurveyReplyTest {

    private SurveyReply surveyReply;

    @BeforeEach
    public void setUp() {
        surveyReply = new SurveyReply();
    }

    @Test
    public void prePersist_shouldSetCreatedAtAndLastModifiedToCurrentDate() {
        // Arrange
        Date currentDate = new Date();

        // Act
        surveyReply.prePersist();

        // Assert
        assertEquals(currentDate, surveyReply.getCreatedAt());
        assertEquals(currentDate, surveyReply.getLastModified());
    }

    @Test
    public void prePersist_shouldSetCreatedAtAndLastModifiedToSameDate() {
        // Arrange
        Date currentDate = new Date();

        // Act
        surveyReply.prePersist();

        // Assert
        assertEquals(surveyReply.getCreatedAt(), surveyReply.getLastModified());
    }

}
